import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

function Navbar() {
  const token = localStorage.getItem('token');
  const navigate = useNavigate();

  const logout = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  return (
    <nav className="flex justify-between items-center px-8 py-4 bg-white shadow">
      <Link to="/" className="text-2xl font-bold text-blue-700">HealthQuest</Link>
      <div className="space-x-4">
        <Link to="/" className="hover:text-blue-600">Home</Link>
        {token && <>
          <Link to="/dashboard" className="hover:text-blue-600">Dashboard</Link>
          <Link to="/workouts" className="hover:text-blue-600">Workouts</Link>
          <Link to="/nutrition" className="hover:text-blue-600">Nutrition</Link>
        </>}
        {!token
          ? <Link to="/login" className="bg-blue-600 text-white px-4 py-2 rounded">Login</Link>
          : <button onClick={logout} className="bg-red-500 text-white px-4 py-2 rounded">Logout</button>
        }
      </div>
    </nav>
  );
}

export default Navbar;
